import React, {Component} from "react";
import '../tabata.css'

class Excercice extends Component {
    render() {
        return(
            <div>
                <div className="card" style={{ width: '18rem' }}>
                    <h5>Vueltas:</h5>
                    <h6 className="mb-2 text-muted">Tiempo de descanso:</h6>
                </div>
            </div>
        );
    }
}

export default Excercice;
